using ObjectiveC;using System;using SharpSwift.Attributes;using System.Collections.Generic;using Foundation;using CoreGraphics;namespace UIKit{    /// <summary>    /// This protocol defines delegate methods for UISearchController objects.    /// </summary>    /// <see cref="https://developer.apple.com/library/prerelease/ios/documentation/UIKit/Reference/UISearchControllerDelegate_Ref/index.html#//apple_ref/occ/intf/UISearchControllerDelegate"/>    [iOSVersion(8)]    public interface UISearchControllerDelegate//: NSObjectProtocol    {        /// <summary>        /// Called when the search controller has been automatically dismissed.        /// </summary>        /// <param name="searchController">The UISearchController object that was dismissed.</param>        [iOSVersion(8)]        [Export("didDismissSearchController")]        void DidDismissSearchController(UISearchController searchController);                /// <summary>        /// Called when the search controller has been automatically presented.        /// </summary>        /// <param name="searchController">The UISearchController object that was presented.</param>        [iOSVersion(8)]        [Export("didPresentSearchController")]        void DidPresentSearchController(UISearchController searchController);                /// <summary>        /// Presents the designated search controller.        /// </summary>        /// <param name="searchController">The UISearchController object to be presented.</param>        [iOSVersion(8)]        [Export("presentSearchController")]        void PresentSearchController(UISearchController searchController);                /// <summary>        /// Called when the search controller is to be automatically dismissed.        /// </summary>        /// <param name="searchController">The UISearchController object to be dismissed.</param>        [iOSVersion(8)]        [Export("willDismissSearchController")]        void WillDismissSearchController(UISearchController searchController);                /// <summary>        /// Called when the search controller is to be automatically displayed.        /// </summary>        /// <param name="searchController">The search controller to present.</param>        [iOSVersion(8)]        [Export("willPresentSearchController")]        void WillPresentSearchController(UISearchController searchController);    }}